import React, { useEffect } from 'react';
import axios from 'axios';

const CakeCollection = () => {
  useEffect(() => {
    const res = axios('/collection');
    console.log(res);
  }, []);

  return <div>CakeCollection</div>;
};

export default CakeCollection;
